Add-Type -AssemblyName System.Windows.Forms
Add-Type -AssemblyName System.Drawing

# Import necessary functions from user32.dll for window dragging
Add-Type @"
    using System;
    using System.Runtime.InteropServices;

    public class User32 {
        [DllImport("user32.dll")]
        public static extern bool ReleaseCapture();
        
        [DllImport("user32.dll")]
        public static extern IntPtr SendMessage(IntPtr hWnd, int Msg, int wParam, int lParam);
    }
"@

# Constants for window dragging
$WM_NCLBUTTONDOWN = 0xA1
$HTCAPTION = 0x2

$IconBase64 = ""
$IconBytes = [Convert]::FromBase64String($IconBase64)
$ims = New-Object IO.MemoryStream($IconBytes, 0, $IconBytes.Length)
$ims.Write($IconBytes, 0, $IconBytes.Length)

# Create the form
$form = New-Object System.Windows.Forms.Form
$form.Text = ""
$form.Size = New-Object System.Drawing.Size(148, 178)
$form.Icon = [System.Drawing.Icon]::FromHandle((New-Object System.Drawing.Bitmap -Argument $ims).GetHIcon())
$form.TopMost = $true
$form.StartPosition = "CenterScreen"
$form.FormBorderStyle = 'None'  # Remove the border
$form.BackColor = [System.Drawing.Color]::DimGray  # Set the form's background color
$form.TransparencyKey = $form.BackColor  # Make the background color transparent

# Create PictureBox to hold the GIF
$pictureBox = New-Object System.Windows.Forms.PictureBox
$pictureBox.SizeMode = "StretchImage"
$pictureBox.Dock = "None"
$pictureBox.Size = New-Object System.Drawing.Size(128, 128)
$pictureBox.BackColor = [System.Drawing.Color]::Transparent

# Base64 encoded GIF
$base64String = ""
$imageBytes = [Convert]::FromBase64String($base64String)
$memoryStream = New-Object System.IO.MemoryStream(, $imageBytes)
$loadedImage = [System.Drawing.Image]::FromStream($memoryStream)
$pictureBox.Image = $loadedImage

# Add PictureBox to the form
$form.Controls.Add($pictureBox)

# Add MouseDown event to the PictureBox to enable dragging
$pictureBox.Add_MouseDown({
        [User32]::ReleaseCapture() | Out-Null
        [User32]::SendMessage($form.Handle, $WM_NCLBUTTONDOWN, $HTCAPTION, 0) | Out-Null
    })

# Create a ContextMenuStrip
$contextMenu = New-Object System.Windows.Forms.ContextMenuStrip
$pictureBox.ContextMenuStrip = $contextMenu

#BonziBuddy
$base64Icon = ""
$iconBytes = [Convert]::FromBase64String($base64Icon)
$iconStream = New-Object System.IO.MemoryStream(, $iconBytes)
$Icon = [System.Drawing.Image]::FromStream($iconStream)
$menuItemBonzi = New-Object System.Windows.Forms.ToolStripMenuItem("Bonzi", $Icon)
$contextMenu.Items.Add($menuItemBonzi)

$menuItemBonzi.Add_Click({
        $base64String = ""
        $imageBytes = [Convert]::FromBase64String($base64String)
        $memoryStream = New-Object System.IO.MemoryStream(, $imageBytes)
        $loadedImage = [System.Drawing.Image]::FromStream($memoryStream)
        $pictureBox.Image = $loadedImage
    })

#Clippy
$base64Icon = ""
$iconBytes = [Convert]::FromBase64String($base64Icon)
$iconStream = New-Object System.IO.MemoryStream(, $iconBytes)
$Icon = [System.Drawing.Image]::FromStream($iconStream)
$menuItemClippy = New-Object System.Windows.Forms.ToolStripMenuItem("Clippy", $Icon)
$contextMenu.Items.Add($menuItemClippy)

$menuItemClippy.Add_Click({
        $base64String = ""
        $imageBytes = [Convert]::FromBase64String($base64String)
        $memoryStream = New-Object System.IO.MemoryStream(, $imageBytes)
        $loadedImage = [System.Drawing.Image]::FromStream($memoryStream)
        $pictureBox.Image = $loadedImage
    })

#Snoopy
$base64Icon = ""
$iconBytes = [Convert]::FromBase64String($base64Icon)
$iconStream = New-Object System.IO.MemoryStream(, $iconBytes)
$Icon = [System.Drawing.Image]::FromStream($iconStream)
$menuItemSnoopy = New-Object System.Windows.Forms.ToolStripMenuItem("Snoopy", $Icon)
$contextMenu.Items.Add($menuItemSnoopy)

$menuItemSnoopy.Add_Click({
        $base64String = ""
        $imageBytes = [Convert]::FromBase64String($base64String)
        $memoryStream = New-Object System.IO.MemoryStream(, $imageBytes)
        $loadedImage = [System.Drawing.Image]::FromStream($memoryStream)
        $pictureBox.Image = $loadedImage
    })

#Wizard
$base64Icon = ""
$iconBytes = [Convert]::FromBase64String($base64Icon)
$iconStream = New-Object System.IO.MemoryStream(, $iconBytes)
$Icon = [System.Drawing.Image]::FromStream($iconStream)
$menuItemWizard = New-Object System.Windows.Forms.ToolStripMenuItem("Wizard", $Icon)
$contextMenu.Items.Add($menuItemWizard)

$menuItemWizard.Add_Click({
        $base64String = ""
        $imageBytes = [Convert]::FromBase64String($base64String)
        $memoryStream = New-Object System.IO.MemoryStream(, $imageBytes)
        $loadedImage = [System.Drawing.Image]::FromStream($memoryStream)
        $pictureBox.Image = $loadedImage
    })

#Separator
$Separator1 = New-Object System.Windows.Forms.ToolStripSeparator
$contextmenu.Items.Add($Separator1)

#Custom
$base64Icon = ""
$iconBytes = [Convert]::FromBase64String($base64Icon)
$iconStream = New-Object System.IO.MemoryStream(, $iconBytes)
$Icon = [System.Drawing.Image]::FromStream($iconStream)
$menuItemCustom = New-Object System.Windows.Forms.ToolStripMenuItem("Custom", $Icon)
$contextMenu.Items.Add($menuItemCustom)

$menuItemCustom.Add_Click({
        $form.Close()
    })

#Close
$base64Icon = ""
$iconBytes = [Convert]::FromBase64String($base64Icon)
$iconStream = New-Object System.IO.MemoryStream(, $iconBytes)
$Icon = [System.Drawing.Image]::FromStream($iconStream)
$menuItemClose = New-Object System.Windows.Forms.ToolStripMenuItem("Close", $Icon)
$contextMenu.Items.Add($menuItemClose)

$menuItemClose.Add_Click({
        $form.Close()
    })

# Show the Form
$form.ShowDialog()